bleAlphabet(myAlphabet) # ABCDEFGHIJKLMNOPQRSTUVWXYZABCDEFGHIJKLMNOPQRSTUVWXYZ Untuk shifting agar z juga bisa di shift ke kanan\n    print(f'Alphabet2: {myAlphabet2}')\n    myMessage = getMessage() # Menerima iputan dari user\n    print(myMessage)\n    myCipherKey = getCipherKey() # Menerima inputan dari user mau shifting berapa karakter. Ex: shift 3, maka 'a' -> 'd'\n    print(myCipherKey)\n    myEncryptedMessage = encryptMessage(myMessage, myCipherKey, myAlphabet2) # Function untuk lakukan shifting. Arguments: Kata yang mau di encript, berapa banyak shiftignya, key untuk enkripsi\n    print(f'Encrypted Message: {myEncryptedMessage}')\n    myDecryptedMessage = decryptMessage(myEncryptedMessage, myCipherKey, myAlphabet2) # Function untuk decript\n    print(f'Decypted Message: {myDecryptedMessage}')\n\n\nrunCaesarCipherProgram()","undoManager":{"mark":-2,"position":100,"stack":[[{"start":{"row":23,"column":70},"end":{"row":23,"column":71},"action":"insert","lines":[" "],"id":436},{"start":{"row":23,"column":71},"end":{"row":23,"column":72},"action":"insert","lines":["e"]},{"start":{"row":23,"column":72},"end":{"row":23,"column":73},"action":"insert","lines":["n"]},{"start":{"row":23,"column":73},"end":{"row":23,"column":74},"action":"insert","lines":["k"]},{"start":{"row":23,"column":74},"end":{"row":23,"column":75},"action":"insert","lines":["r"]},{"start":{"row":23,"column":75},"end":{"row":23,"column":76},"action":"insert","lines":["i"]},{"start":{"row":23,"column":76},"end":{"row":23,"column":77},"action":"insert","lines":["s"]}],[{"start":{"row":23,"column":76},"end":{"row":23,"column":77},"action":"remove","lines":["s"],"id":437}],[{"start":{"row":23,"column":76},"end":{"row":23,"column":77},"action":"insert","lines":["p"],"id":438},{"start":{"row":23,"column":77},"end":{"row":23,"column":78},"action":"insert","lines":["s"]},{"start":{"row":23,"column":78},"end":{"row":23,"column":79},"action":"insert","lines":["i"]}],[{"start":{"row":23,"column":87},"end":{"r